import mongoose from "mongoose";

const userSchema = new mongoose.Schema({
    name : {type:String,required:true},
    email : {type:String,required:true,unique:true},
    password : {type:String,required:true},
    image : {type:String,default:"data:image/png;base64,"},
    gender : {type:String,default:"Not Selected"},
    dob : {type:String,default:"Not Selected"},
    address  : {type:Object, default: {Location:'',line:''}},
    phone  : {type:Object,default:"0000000000"},
    full_address  : {type:String,default:"Not Selected"},
    pet_type  : {type:String,default:"Small Animal"},
    pet_age  : {type:String,default:"1"},
    pet_gender  : {type:String,default:"Male"},
    breed  : {type:String,default:"Not Selected"},
    category  : {type:String,default:"Not Selected"},
    verifyOtp : {type : String , default: ''},
    verifyOtpExpiredAt : {type : Number , default: 0},
    isAccountverified : {type : Number , default: false},
    verifyOtpVerified : {type : Number , default: false},
    resetOtp : {type : Number , default: ''},
    resetOtpExpireAt : {type : Number , default: 0},
})

const userModel = mongoose.models.user || mongoose.model('user' , userSchema);

export default userModel